import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  const user_id = localStorage.getItem("user_id");

  const handleLogout = () => {
    localStorage.removeItem("user_id");
    localStorage.removeItem("user_id");
  };

  return (
    <header className="navbar">
      <Link to="/signin" className="navLink">
        <div className="logo">HARU NOTE</div>
      </Link>

      <nav>
        <ul className="navList">
          <div className="navLine"></div>
          <li className="navItem">
            <Link to="/calendar" className="navLink">
              Calendar
            </Link>
          </li>
          <li className="navItem">
            <Link to="/blog" className="navLink">
              Blog
            </Link>
          </li>
          {!user_id && (
            <li className="navLinkWrapper">
              <Link to="/signup" className="navLink">
                Sign up
              </Link>
            </li>
          )}
          <li className={user_id ? "navItemLogout" : "navItemSignin"}>
            {user_id ? (
              <button className="navLinkLogout" onClick={handleLogout}>
                Logout
              </button>
            ) : (
              <Link to="/signin" className="navLinkSignin">
                Sign in
              </Link>
            )}
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
